import { DataType } from './dataConstants';
export const isDefined = (value) => value != null;
export const isValid = (predicate) => (t) => predicate(t);
// As of now, we only check if the current component supports string or not.
export const isSupportedDataType = (supportsString) => ({ dataType }) => (supportsString && dataType === DataType.STRING) || dataType !== DataType.STRING;
export const isNumberDataStream = (stream) => stream.dataType === DataType.NUMBER;
export const isNumber = (val) => typeof val === 'number';
export const isMinimalStaticViewport = (viewport) => 'start' in viewport && 'end' in viewport;
